.mainBox {
  background-color: white;
  position: relative;
  display: flex;
  flex-wrap: wrap;
  margin: 0 auto;
  border: 2px solid black;
  border-radius: 10px;
  justify-content: space-around;
  box-shadow: 5px 5px 5px 5px rgb(219, 219, 219);
  font-family: sans-serif;
  font-size: 16px;
  padding-bottom: 40px;
}

.card {
  overflow: hidden;
  height: 300px;
  border-radius: 10px;
  margin: 10px 0;
  box-shadow: 2px 2px 2px 2px rgb(219, 219, 219);
  text-align: center;
  display: flex;
  flex-direction: column;
}

p {
  width: 100%;
  text-align: center;
  margin: auto;
}

button {
  background-color: orange;
  border-radius: 10px;
  margin-bottom: 0 8px 8px;
  padding: 10px;
  font-family: sans-serif;
  font-size: 16px;
  padding: 10px;
}

.checkout {
  position: absolute;
  bottom: 0;
  background-color: orange;
  padding: 10px;
  border-radius: 10px;
}

.counter {
  display: flex;
  justify-content: space-between;
  width: 70%;
  margin: 0 auto;
}

img {
  display: block;
  margin-left: auto;
  margin-right: auto;
}
